import React from "react";
import Header from "./components/Header";
import Note from "./components/Note"
import Footer from "./components/Footer";
import notes from "./notes";

function createNote(note) {
    return (
        <Note 
        id={note.id}
        key={note.id}
        title={note.title}
        content={note.content}
        />
    );
}

function App() {
    return <div>
        <Header />
        {notes.map((note) =>{
            <Note
            id={note.id}
            key={note.id}
            title={note.title}
            content={note.content}
            />
        })}
        <Footer />
    </div>
}

export default App;
